import { Container, AppBar, Typography, Grow, Grid } from '@mui/material';

function App() {
  return (
    <div className="App">
      <Container maxWidth="xl">
        <AppBar position="static" color="inherit">
          <Typography variant='h2' align='center'>Instagram </Typography>
          <img src='{logo}' alt='instagram' height={60} />
        </AppBar>
      </Container>
    </div>
  );
}

export default App;
